import { FaGithub, FaLinkedin } from "react-icons/fa";
import Avatar from '../assets/Software.png';

import videoBg from "../assets/beach-isla.mov"

const Body = () => {
    return (
        <div id="body" className="body">
            <div className="body-container">
                <div className="body-profile">
                    <img className="body-img" alt='avatar' src={videoBg} autoPlay loop muted />

                    <div className="body-content">
                        <div className="body-headline">Sathwik Kesappragada</div>
                        <div className="body-text">Data Analyst</div>
                    </div>

                    <div className="body-icons">
                        <a href="https://www.educative.io/" target="_blank" rel="noreferrer" className="icon-link"><i><FaGithub /></i> </a>
                        <a href="https://www.educative.io/" target="_blank" rel="noreferrer" className="icon-link"><i><FaLinkedin /></i></a>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Body;
